{"title": "The Air I Breathe", "reviews": "\u201cThe Air I Breathe\u201d is an ingenious contraption that holds your attention for as long as it whirs and clicks like a mechanized Rubik\u2019s Cube.  A drama based on an ancient Chinese proverb that breaks life down into four emotional cornerstones: happiness, pleasure, sorrow and love. A businessman bets his life on a horse race; a gangster sees the future; a pop star (Gellar) falls prey to a crime boss; a doctor must save the love of his life. ", "popularity": null, "stemmed_review": ["on", "contraption", "and", "The", "emotional", "love", "prey", "your", "Air", "down", "pleasure", "falls", "Cube", "mechanized", "holds", "breaks", "A", "doctor", "I", "Breathe", "happiness", "ingenious", "Gellar", "sorrow", "the", "life", "into", "gangster", "race", "it", "pop", "star", "save", "is", "must", "attention", "based", "crime", "Rubik's", "a", "cornerstones", "horse", "his", "like", "an", "as", "for", "businessman", "future", "whirs", "of", "bets", "boss", "that", "long", "to", "ancient", "proverb", "Chinese", "sees", "four", "drama", "clicks"], "sbert_vector": [0.4889542758464813, 0.3074931800365448, 0.07311145961284637, -0.511823832988739, -0.00027910186327062547, 0.015338518656790257, 0.3314210772514343, 0.14359831809997559, 0.5799708962440491, -0.17668864130973816, -0.2589913010597229, 0.17832361161708832, -0.415763258934021, -0.06983998417854309, 0.042582057416439056, -0.6295554041862488, 0.2865176200866699, -0.01036299392580986, 0.31900179386138916, -0.0024091696832329035, 0.0032871258445084095, 0.1935615837574005, -0.3235878348350525, -0.07536464184522629, 0.2916434109210968, 0.010367739014327526, -0.0840643048286438, 0.05961642041802406, -0.21765078604221344, 0.047942325472831726, -0.3727433383464813, 0.11694911122322083, -0.1319379210472107, -0.2230772078037262, -0.054673485457897186, -0.13149602711200714, -0.39096832275390625, 0.1760016530752182, -0.05585940182209015, 0.1979345977306366, -0.07023951411247253, 0.