{"title": "The Business of Being Born", "reviews": "Director Abby Epstein's controversial documentary takes a hard look at America's maternity care system, juxtaposing hospital deliveries against the growing popularity of at-home, natural childbirths that some expectant parents are opting for. Former talk show host Ricki Lake was inspired to produce this compelling expos\u00e9 after a dissatisfying birthing experience with her first child left her with many unanswered questions. \u201cThe Business of Being Born\u201d is a passionate ground-level examination of home childbirth. ", "popularity": null, "stemmed_review": ["Born", "The", "Epstein's", "maternity", "takes", "show", "passionate", "childbirths", "ground", "expectant", "parents", "Being", "with", "after", "birthing", "some", "look", "Director", "expose", "talk", "Abby", "compelling", "first", "childbirth", "the", "juxtaposing", "at", "this", "many", "controversial", "growing", "America's", "dissatisfying", "is", "examination", "against", "a", "popularity", "left", "questions", "hard", "care", "produce", "Lake", "system", "Business", "for", "Former", "experience", "home", "of", "child", "opting", "natural", "deliveries", "that", "documentary", "to", "her", "host", "was", "unanswered", "Ricki", "hospital", "are", "inspired", "level"], "sbert_vector": [0.6199709177017212, -0.1489943563938141, -0.5961785912513733, -0.007991310209035873, 0.2496701180934906, -0.0016593483742326498, -0.4995538294315338, -0.14450198411941528, 0.5029823184013367, 0.5788946747779846, 0.2899906039237976, -0.20248350501060486, 0.009060587733983994, 0.19854320585727692, -0.5098035335540771, 0.009914706461131573, -0.2095773071050644, -0.23660670220851898, -0.5073819756507874, -0.14571624994277954, -0.1438828855752945, -0.3044087290763855, -0.11549060046672821, 0.14681187272071838, -0.2518695294857025, 0.013408839702606201, 0.04693644493818283, -0.6624480485916138, -0.2164146602153778, -0.03550480678677559, 0.24054953455924988, -0.292889952