{"title": "Helen", "reviews": "An 18 year old girl called Joy has gone missing. Another girl called Helen is a few weeks away from leaving her care home. Helen is asked to 'play' Joy in a police reconstruction that will retrace Joy's last known movements. Joy had everything. A loving family, a boyfriend, a bright future. Helen, parent-less, has lived in institutions all her life and has never been close to anyone. Gradually Helen begins to immerse herself into the role, visiting the people and places that Joy knew; quietly and carefully insinuating her way into the lost girl's life. But is Helen trying to find out what happened to Joy that day, or is she searching for her own identity? In Sandra Nettelbeck\u2019s drama, a wife and mother slowly loses her grip. On the outside, Helen has it all \u2013 a loving family and a successful career \u2013 but when her suppressed mental illness resurfaces, the world crumbles around her. Crippled by depression, Helen finds solace through her friendship with Mathilda, a kindred spirit struggling with bipolar disorder. ", "popularity": null, "stemmed_review": ["immerse", "bright", "all", "illness", "world", "mental", "few", "In", "Joy", "identity", "away", "when", "day", "has", "find", "future", "carefully", "play", "police", "and", "close", "Nettelbeck's", "retrace", "herself", "career", "movements", "A", "trying", "missing", "with", "An", "finds", "but", "known", "old", "had", "by", "Helen", "from", "is", "Another", "successful", "On", "parent", "in", "Sandra", "care", "Joy's", "insinuating", "will", "girl's", "for", "home", "through", "Mathilda", "that", "her", "to", "begins", "suppressed", "role", "she", "girl", "drama", "friendship", "been", "around", "what", "weeks", "lived", "year", "never", "less", "visiting", "places", "slowly", "wife", "disorder", "the", "life", "Crippled", "it", "reconstruction", "depression", "anyone", "own", "resurfaces", "bipolar", "or", "gone", "lost", "loses", "quietly", "kindred", "everything", "