{"title": "Teenage Mutant Ninja Turtles", "reviews": "A quartet of humanoid turtles, trained by their mentor in ninjitsu, must learn to work together to face the menace of Shredder and the Foot Clan. The city needs heroes. Darkness has settled over New York City as Shredder and his evil Foot Clan have an iron grip on everything from the police to the politicians. The future is grim until four unlikely outcast brothers rise from the sewers and discover their destiny as Teenage Mutant Ninja Turtles. The Turtles must work with fearless reporter April and her wise-cracking cameraman Vern Fenwick to save the city and unravel Shredder's diabolical plan. When a kingpin threatens New York City, a group of mutated turtle warriors must emerge from the shadows to protect their home. A quartet of mutated humanoid turtles clash with an uprising criminal gang of ninjas ", "popularity": null, "stemmed_review": ["evil", "their", "emerge", "unlikely", "politicians", "mutated", "turtle", "cameraman", "Shredder", "outcast", "city", "his", "heroes", "has", "future", "clash", "ninjas", "threatens", "fearless", "police", "grim", "Vern", "and", "trained", "destiny", "A", "cracking", "criminal", "with", "April", "group", "by", "from", "must", "is", "work", "mentor", "in", "warriors", "an", "shadows", "home", "her", "to", "four", "on", "City", "discover", "settled", "together", "iron", "Ninja", "Shredder's", "ninjitsu", "face", "the", "Teenage", "New", "humanoid", "Fenwick", "over", "needs", "of", "plan", "Foot", "kingpin", "quartet", "everything", "unravel", "Turtles", "The", "menace", "uprising", "learn", "gang", "sewers", "reporter", "diabolical", "Mutant", "until", "save", "a", "protect", "grip", "brothers", "Darkness", "as", "wise", "have", "rise", "York", "Clan", "turtles", "When"], "sbert_vector": [0.6403359770774841, -0.5486873388290405, -0.26875039935112, -0.4678478538990021, 0.0076597160659730434, -0.26018986105918884, -0.19613614678382874, -0.28285184502601624, 0.7454346418380737