{"title": "Life of Brian", "reviews": "Brian Cohen is an average young Jewish man, but through a series of ridiculous events, he gains a reputation as the Messiah. When he's not dodging his followers or being scolded by his shrill mother, the hapless Brian has to contend with the pompous Pontius Pilate and acronym-obsessed members of a separatist movement. Rife with Monty Python's signature absurdity, the tale finds Brian's life paralleling Biblical lore, albeit with many more laughs. Brian Cohen is an average young Jewish man, but through a series of ridiculous events, he gains a reputation as the Messiah. When he's not dodging his followers or being scolded by his shrill mother, the hapless Brian has to contend with the pompous Pontius Pilate and acronym-obsessed members of a separatist movement. Rife with Monty Python's signature absurdity, the tale finds Brian's life paralleling Biblical lore, albeit with many more laughs. ", "popularity": null, "stemmed_review": ["ridiculous", "mother", "and", "shrill", "tale", "man", "Brian's", "followers", "separatist", "average", "Biblical", "contend", "members", "Messiah", "lore", "with", "Rife", "paralleling", "finds", "but", "laughs", "movement", "the", "scolded", "life", "being", "by", "many", "dodging", "is", "albeit", "Monty", "gains", "a", "hapless", "he", "his", "Pontius", "reputation", "an", "has", "as", "Jewish", "obsessed", "or", "pompous", "Python's", "he's", "more", "of", "through", "events", "absurdity", "series", "to", "acronym", "young", "not", "Pilate", "signature", "Cohen", "Brian", "When"], "sbert_vector": [-0.5073862671852112, 0.0741117000579834, -0.08944530785083771, -0.7384173274040222, -0.5243072509765625, -0.21694031357765198, 0.32629114389419556, 0.5479694604873657, -0.30860623717308044, 0.2546405792236328, -0.3543238639831543, -0.18577586114406586, -0.4141762852668762, -0.6281969547271729, 0.12042565643787384, -0.24439896643161774, 0.22957246005535126, -0.14241789281368256, -0.2041921764612198, 0.02